@georginagio arrived at the 78th Venice International Film Festival matching her exclusive Hermès Birkin with a rare @rolex Day-Date. This special 36mm Day-Date has a lavender jade dial with diamonds in a 18k yellow gold case. The Day-Date’s case is produced exclusively in precious materials such as yellow gold, white gold, rose gold and platinum. #Rolex

Retail price: $ 49,100.00

Photo: @georginagio

@alecmonopoly in this recent shot was wearing a discontinued @rolex Day-Date 218238 in 18k yellow gold with black ‘wave’ dial. This timepiece has a 41mm case with a fluted yellow gold bezel over an unusual black wave patterned dial, yellow gold arabic numerals and yellow gold hands. Produced from 2008 until 2015, the Day-Date II with its bigger case builds on the exclusive heritage of the original Day-Date. #Rolex

Retail price: $ 37,550.00

Photo: @alecmonopoly | @rolex
